class Simbolo {

    constructor (nombre, tipo, ambito, fila, columna, valor='', indice = null) {
        this.nombre = nombre;
        this.tipo = tipo;
        this.ambito = ambito;
        this.fila = fila;
        this.columna = columna;
        this.valor = valor;
        this.indice = indice;
    }

}